DROP TABLE IF EXISTS `students`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `students` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `program_id` int(11) DEFAULT NULL,
  `card` varchar(20) DEFAULT NULL,
  `previous_card` varchar(20) DEFAULT NULL,
  `consecutive` int(11) DEFAULT NULL,
  `first_name` varchar(50) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `gender` varchar(1) DEFAULT NULL,
  `date_of_birth` date DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `state_id` int(11) DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `previous_institution` int(11) DEFAULT NULL,
  `previous_degree_type` varchar(255) DEFAULT NULL,
  `previous_degree_desc` varchar(255) DEFAULT NULL,
  `previous_degree_date` date DEFAULT NULL,
  `contact_id` int(11) DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `graduation_date` date DEFAULT NULL,
  `inactive_date` date DEFAULT NULL,
  `supervisor` int(11) DEFAULT NULL,
  `co_supervisor` int(11) DEFAULT NULL,
  `department_id` int(11) DEFAULT NULL,
  `curp` varchar(255) DEFAULT NULL,
  `ife` varchar(255) DEFAULT NULL,
  `cvu` varchar(255) DEFAULT NULL,
  `location` varchar(255) DEFAULT NULL,
  `ssn` varchar(255) DEFAULT NULL,
  `blood_type` varchar(255) DEFAULT NULL,
  `accident_contact` varchar(255) DEFAULT NULL,
  `accident_phone` varchar(255) DEFAULT NULL,
  `passport` varchar(255) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  `notes` text,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `campus_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_students_on_card` (`card`),
  KEY `index_students_on_supervisor` (`supervisor`),
  KEY `index_students_on_co_supervisor` (`co_supervisor`),
  KEY `index_students_on_program_id` (`program_id`),
  KEY `index_students_on_contact_id` (`contact_id`),
  KEY `index_students_on_country_id` (`country_id`),
  KEY `index_students_on_department_id` (`department_id`),
  KEY `index_students_on_campus_id` (`campus_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1131 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

